function Footer() {
  return (
    <footer>
      <div>
        <svg id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" width="250px"  viewBox="0 0 1195.76 182.15">
          <defs>
            <style>
              {`.cls-1 {
        font-size: 144.94px;
        font-family: Gardenia-Regular, Gardenia;
        letter-spacing: -0.02em;
      }`}

              {`.cls-2 {
                stroke: #fff;
                stroke-miterlimit: 8;
                stroke-width: 8px;
                fill: url(#linear-gradient);
      }`}
            </style>
            <linearGradient id="linear-gradient" x1="5" y1="82.31" x2="227.17" y2="82.31" gradientUnits="userSpaceOnUse">
      <stop offset="0" stop-color="#552586"/>
      <stop offset="1" stop-color="#6a359c"/>
    </linearGradient>
          </defs>
          <text class="cls-1" transform="translate(252.23 136.93)">
            Mason Thomas
          </text>
          <polygon
            class="cls-2"
            points="160.31 0 111.09 85.26 61.86 0 60.02 0 0 0 0 154.61 222.17 154.61 222.17 0 160.31 0"
          />
        </svg>
      </div>
    </footer>
  );
}

export default Footer;
